import{_ as a,c as t,a2 as i,o as l}from"./chunks/framework.cddoPPhG.js";const c=JSON.parse('{"title":"Praktikumsplätze","description":"","frontmatter":{},"headers":[],"relativePath":"features/Praktikumsplaetze.md","filePath":"features/Praktikumsplaetze.md","lastUpdated":1727811195000}'),r={name:"features/Praktikumsplaetze.md"};function s(n,e,o,h,d,u){return l(),t("div",null,e[0]||(e[0]=[i('<h1 id="praktikumsplatze" tabindex="-1">Praktikumsplätze <a class="header-anchor" href="#praktikumsplatze" aria-label="Permalink to &quot;Praktikumsplätze&quot;">​</a></h1><p>On the main page, there is an option <code>Praktikumsplätze</code> in the navigation bar. This takes you to a new page. This page displays the <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a> that have already been registered for the current <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a>. If no <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a> have been registered yet, the user is also informed of this. The <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a> are grouped according to the <a href="./../glossary.html#dienststelle">Dienststelle</a>. Individual <a href="./../glossary.html#dienststelle">Dienststellengruppen</a> can be expanded and all reported <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a> from the <a href="./../glossary.html#dienststelle">Dienststelle</a> are displayed. The individual <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a> can also be expanded again. This means that all possible information on a <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a> is displayed.</p><p>This page is only available for <a href="./../glossary.html#ortliche-ausbildungsleitung">örtliche Ausbildungsleitung</a> and <a href="./../glossary.html#ortliche-ausbilderin">örtliche Ausbilderin</a>. The <a href="./../glossary.html#ortliche-ausbildungsleitung">Ausbildungsleitung</a> can use all actions on the page. The <a href="./../glossary.html#ortliche-ausbilderin">Ausbilderinnen</a> can only use <a href="#submission-ortliche-ausbilderin">submission</a>. They cannot see any other data or use other actions.</p><h2 id="submission-ortliche-ausbilderin" tabindex="-1">Submission örtliche Ausbilderin <a class="header-anchor" href="#submission-ortliche-ausbilderin" aria-label="Permalink to &quot;Submission örtliche Ausbilderin&quot;">​</a></h2><p>On the page there is a button labeled <code>Hinzufügen</code>. Clicking this button will open a dialog.</p><p>In this dialog, you can choose whether you want to report a <a href="./../glossary.html#studentin">student</a> (<code>Studium</code>) or a <a href="./../glossary.html#auszubildende">trainee</a> (<code>Ausbildung</code>). This will open a page with the corresponding form.</p><h2 id="submission-ortliche-ausbildungsleitung" tabindex="-1">Submission örtliche Ausbildungsleitung <a class="header-anchor" href="#submission-ortliche-ausbildungsleitung" aria-label="Permalink to &quot;Submission örtliche Ausbildungsleitung&quot;">​</a></h2><p>If the user has the role for <a href="./../glossary.html#ortliche-ausbildungsleitung">örtliche Ausbildungsleitung</a> On the page there is a button labeled <code>Hinzufügen</code>. Clicking this button will open a dialog.</p><p>In this dialog, you can choose whether you want to report a <a href="./../glossary.html#studentin">student</a> (<code>Studium</code>) or a <a href="./../glossary.html#auszubildende">trainee</a> (<code>Ausbildung</code>). This will open a page with the corresponding form.</p><p>As <a href="./../glossary.html#ortliche-ausbildungsleitung">örtliche Ausbildungsleitung</a> you have the option to add the <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a> to a specific <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a>. Therefor the form has a mandatory selector for the <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a>.</p><h2 id="using-the-forms" tabindex="-1">Using the Forms <a class="header-anchor" href="#using-the-forms" aria-label="Permalink to &quot;Using the Forms&quot;">​</a></h2><h3 id="stellenbeschreibung" tabindex="-1">Stellenbeschreibung <a class="header-anchor" href="#stellenbeschreibung" aria-label="Permalink to &quot;Stellenbeschreibung&quot;">​</a></h3><p>In this section the user can provide general information about the <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a>.</p><h4 id="dienststelle" tabindex="-1">Dienststelle <a class="header-anchor" href="#dienststelle" aria-label="Permalink to &quot;Dienststelle&quot;">​</a></h4><p>Text field for the team name. e.g. <code>KM83</code></p><h4 id="referat" tabindex="-1">Referat <a class="header-anchor" href="#referat" aria-label="Permalink to &quot;Referat&quot;">​</a></h4><p>Selection between <code>it@M</code> and <code>RIT</code></p><h4 id="dringlichkeit" tabindex="-1">Dringlichkeit <a class="header-anchor" href="#dringlichkeit" aria-label="Permalink to &quot;Dringlichkeit&quot;">​</a></h4><p>Selection between <code>Zwingend</code>, <code>Dringend</code>, and <code>Nachrangig</code>. Meaning <code>Urgent</code>, <code>Important</code>, and <code>Not important</code>.</p><h4 id="planstelle" tabindex="-1">Planstelle <a class="header-anchor" href="#planstelle" aria-label="Permalink to &quot;Planstelle&quot;">​</a></h4><p>Radio button <code>Yes/No</code> selector for whether the <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a> is a <a href="./../glossary.html#planstelle">Planstelle</a></p><h4 id="ausbildung-projektarbeit" tabindex="-1">Ausbildung: Projektarbeit <a class="header-anchor" href="#ausbildung-projektarbeit" aria-label="Permalink to &quot;Ausbildung: Projektarbeit&quot;">​</a></h4><p>A classic <code>Yes/No</code> selector for letting the <a href="./../glossary.html#ortliche-ausbildungsleitung">örtliche Ausbildungsleitung</a> know that the <a href="./../glossary.html#auszubildende">trainee</a> is able to do their final year project there</p><h4 id="namentliche-anforderung" tabindex="-1">Namentliche Anforderung <a class="header-anchor" href="#namentliche-anforderung" aria-label="Permalink to &quot;Namentliche Anforderung&quot;">​</a></h4><p>Text field for requesting a specific <a href="./../glossary.html#nwk">Nwk</a></p><h4 id="tatigkeiten" tabindex="-1">Tätigkeiten <a class="header-anchor" href="#tatigkeiten" aria-label="Permalink to &quot;Tätigkeiten&quot;">​</a></h4><p>Text field for noting the operations performed by the team and what the <a href="./../glossary.html#nwk">Nwk</a> will most likely be doing there.</p><h3 id="nachwuchskraft" tabindex="-1">Nachwuchskraft <a class="header-anchor" href="#nachwuchskraft" aria-label="Permalink to &quot;Nachwuchskraft&quot;">​</a></h3><p>This section asks the user to provide information about the <a href="./../glossary.html#nwk">Nwk</a> this <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a> is designed for.</p><h4 id="studium-studiengang" tabindex="-1">Studium: Studiengang <a class="header-anchor" href="#studium-studiengang" aria-label="Permalink to &quot;Studium: Studiengang&quot;">​</a></h4><p>Selection between the different study majors e.g. <code>Informatik (B.Sc.)</code></p><h4 id="ausbildung-ausbildungsrichtung" tabindex="-1">Ausbildung: Ausbildungsrichtung <a class="header-anchor" href="#ausbildung-ausbildungsrichtung" aria-label="Permalink to &quot;Ausbildung: Ausbildungsrichtung&quot;">​</a></h4><p>Selection between different training programs, e.g. <code>FISI</code></p><h4 id="studium-studiensemester" tabindex="-1">Studium: Studiensemester <a class="header-anchor" href="#studium-studiensemester" aria-label="Permalink to &quot;Studium: Studiensemester&quot;">​</a></h4><p>Multi selection between <code>1. </code> to <code>6.</code> Semester</p><p>When a <a href="#studium-studiengang">Studiengang</a> is selected, an estimated timeframe for the assignment is shown per semester.</p><h4 id="ausbildung-ausbildungsjahr" tabindex="-1">Ausbildung: Ausbildungsjahr <a class="header-anchor" href="#ausbildung-ausbildungsjahr" aria-label="Permalink to &quot;Ausbildung: Ausbildungsjahr&quot;">​</a></h4><p>Multi selection between <code>1.</code> to <code>3.</code> Year of training</p><p>When a <a href="#ausbildung-ausbildungsrichtung">Ausbildungsrichtung</a> is selected, an estimated timeframe for the assignment is shown per year of training.</p><p>(1st year is removed for <code>FISI</code> because they are trained at a different location for the first year)</p><h4 id="programmierkenntnisse" tabindex="-1">Programmierkenntnisse <a class="header-anchor" href="#programmierkenntnisse" aria-label="Permalink to &quot;Programmierkenntnisse&quot;">​</a></h4><p>A selector for requesting a <a href="./../glossary.html#nwk">Nwk</a> who can code.</p><p>Options: <code>Ja</code>, <code>Nein</code>, <code>Egal</code>. Meaning <code>Yes</code>, <code>No</code>, <code>Doesn&#39;t matter</code>.</p><h3 id="ortliche-ausbilderin" tabindex="-1">Örtliche Ausbilderin <a class="header-anchor" href="#ortliche-ausbilderin" aria-label="Permalink to &quot;Örtliche Ausbilderin&quot;">​</a></h3><h4 id="name-ortliche-ausbilderin" tabindex="-1">Name örtliche Ausbilderin <a class="header-anchor" href="#name-ortliche-ausbilderin" aria-label="Permalink to &quot;Name örtliche Ausbilderin&quot;">​</a></h4><p>Text field for the name of the person (<a href="./../glossary.html#ortliche-ausbilderin">örtlicher Ausbilderin</a>) in the team responsible for the <a href="./../glossary.html#nwk">Nwk</a></p><h4 id="kontakt-e-mail-ortliche-ausbilderin" tabindex="-1">Kontakt E-Mail örtliche Ausbilderin <a class="header-anchor" href="#kontakt-e-mail-ortliche-ausbilderin" aria-label="Permalink to &quot;Kontakt E-Mail örtliche Ausbilderin&quot;">​</a></h4><p>Text field for the contact email of the <a href="./../glossary.html#ortliche-ausbilderin">örtliche Ausbilderin</a></p><h3 id="meldezeitraums-auswahl" tabindex="-1">Meldezeitraums Auswahl <a class="header-anchor" href="#meldezeitraums-auswahl" aria-label="Permalink to &quot;Meldezeitraums Auswahl&quot;">​</a></h3><p>This field lets you choose the <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a> to assign the <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a> to. The current <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a> is the top option, followed by the upcoming <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a> and then all the previous <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a>. The upcoming and passed <a href="./../glossary.html#meldezeitraum">Meldezeiträume</a> are sorted by date closest to the current date.</p><p>This feature is only available for <a href="./../glossary.html#ortliche-ausbildungsleitung">örtliche Ausbildungsleitungen</a>.</p><h3 id="sending" tabindex="-1">Sending <a class="header-anchor" href="#sending" aria-label="Permalink to &quot;Sending&quot;">​</a></h3><p>When clicking the <code>SPEICHERN</code> button, the data is sent. A green notification appears if it was successful, if not a red error will appear.</p><h2 id="deletion" tabindex="-1">Deletion <a class="header-anchor" href="#deletion" aria-label="Permalink to &quot;Deletion&quot;">​</a></h2><p>It is possible to delete <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a> in the overview of <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a> by clicking the delete button, marked with a trash can.</p><h2 id="additional-information" tabindex="-1">Additional Information <a class="header-anchor" href="#additional-information" aria-label="Permalink to &quot;Additional Information&quot;">​</a></h2><h3 id="mandatory-information" tabindex="-1">Mandatory information <a class="header-anchor" href="#mandatory-information" aria-label="Permalink to &quot;Mandatory information&quot;">​</a></h3><p>The mandatory information is marked with <code>*</code></p><h3 id="link-between-praktikumsstellen-and-meldezeitraum" tabindex="-1">Link between <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a> and <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a> <a class="header-anchor" href="#link-between-praktikumsstellen-and-meldezeitraum" aria-label="Permalink to &quot;Link between [Praktikumsstellen](../glossary.md#praktikumsstelle) and [Meldezeitraum](../glossary.md#meldezeitraum)&quot;">​</a></h3><p>When a <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a> is reported, it is verified that there is an active <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a> at that moment.</p><p>When there is an active <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a>, it will be assigned to that <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a>.</p><p>When there is no active <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a>, the <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a> will not be reported and an error is shown.</p><p>This makes sure that <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a> are only reported in certain time frames that the <a href="./../glossary.html#ortliche-ausbildungsleitung">örtliche Ausbildungsleitung</a> wants.</p><p>When there is no active <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a> a message will appear telling the user it is currently not possible to submit new <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a>.</p><p>The <a href="./../glossary.html#ortliche-ausbildungsleitung">örtliche Ausbildungsleitung</a> can report <a href="./../glossary.html#praktikumsstelle">Praktikumsstellen</a> anytime.</p><p>If a <a href="./../glossary.html#ortliche-ausbilderin">örtliche Ausbilderin</a> wants to report a <a href="./../glossary.html#praktikumsstelle">Praktikumsstelle</a> outside the <a href="./../glossary.html#meldezeitraum">Meldezeitraum</a>, they have to contact the <a href="./../glossary.html#ortliche-ausbildungsleitung">örtliche Ausbildungsleitung</a>.</p>',66)]))}const g=a(r,[["render",s]]);export{c as __pageData,g as default};
